apiVersion: operators.coreos.com/v1alpha1
kind: ClusterServiceVersion
metadata:
  annotations:
    alm-examples: |-
      [
        {
          "apiVersion": "anzograph.clusters.cambridgesemantics.com/v1",
          "kind": "AnzoGraph",
          "metadata": {
            "name": "azg01"
          },
          "spec": {
            "dbSpec": {
              "resources": {
                "limits": {
                  "cpu": "8000m",
                  "memory": "8Gi"
                },
                "requests": {
                  "cpu": "8000m",
                  "memory": "8Gi"
                }
              },
              "size": 1
            },
            "frontendSpec": {
              "resources": {
                "limits": {
                  "cpu": "2000m",
                  "memory": "4Gi"
                },
                "requests": {
                  "cpu": "2000m",
                  "memory": "4Gi"
                }
              },
              "size": 1
            },
            "serviceAccountName": "anzograph-operator"
          }
        }
      ]
    capabilities: Basic Install
    categories: Database, Big Data
    description: kubernetes operator for AnzoGraph DB
    containerImage: registry.connect.redhat.com/cambridgesemantics/anzograph-operator:1.3.3
    createdAt: 2020-07-17
    certified: "true"
    support: Cambridge Semantics
    repository: ""
  name: anzograph-operator.v1.3.3
  namespace: default
spec:
  apiservicedefinitions: {}
  customresourcedefinitions:
    owned:
    - description: AnzoGraph is the Schema for the anzographs API
      kind: AnzoGraph
      name: anzographs.anzograph.clusters.cambridgesemantics.com
      version: v1
      resources:
      - kind: Service
        name: ''
        version: v1
      - kind: StatefulSet
        name: ''
        version: v1
      - kind: Pod
        name: ''
        version: v1
      - kind: ConfigMap
        name: ''
        version: v1
      - kind: Secret
        name: ''
        version: v1
      - kind: AnzoGraph
        name: ''
        version: v1
      - kind: PersistentVolumeClaim
        name: ''
        version: v1
      - kind: Event
        name: ''
        version: v1
      specDescriptors:
      - description: Resource Specification for AnzoGraph DB
        displayName: DB Spec
        path: dbSpec
      - description: Resource Specification for AnzoGraph Frontend(UI)
        displayName: Frontend Spec
        path: frontendSpec
      - description: Service account used to deploy AnzoGraph cluster
        displayName: Service Account
        path: serviceAccountName
      statusDescriptors:
      - description: Event reason for AnzoGraph cluster deployed
        displayName: Reason
        path: reason
        x-descriptors:
        - 'urn:alm:descriptor:com.tectonic.ui:reason'
      - description: Human readable message for current state of AnzoGraph cluster
        displayName: Message
        path: message
        x-descriptors:
        - 'urn:alm:descriptor:com.tectonic.ui:message'
      - description: Current phase of AnzoGraph cluster like Creating/Running/Failed
        displayName: Phase
        path: phase
        x-descriptors:
        - 'urn:alm:descriptor:com.tectonic.ui:phase'
      - description: Number of ready serving pods in AnzoGraph cluster
        displayName: Ready Replicas
        path: readyReplicas
        x-descriptors:
        - 'urn:alm:descriptor:com.tectonic.ui:readyReplicas'
  description: "The AnzoGraph Operator provides the way to install and configure an AnzoGraph\ncluster on Red Hat K8S environment.\n\n### Installation\n Refer [installation instructions]( https://cambridgesemantics.com/assets/k8s/csi-k8s-operator-anzograph/v1.3.3/README_openshift_marketplace.md )\n\n### Documentation\n\nYou can find our documentation [here.]( https://docs.cambridgesemantics.com/anzograph/userdoc/ )\n\n### Support\n\nWe offer Support to our customers with the AnzoGraph db Enterprise Edition License [here]( https://customercenter.cambridgesemantics.com/ ). For AnzoGraph db Free Edition questions, get help from our Anzograph User Community at Stack Overflow. When submitting a question, include the tag 'anzograph'."
  displayName: AnzoGraph Operator
  icon:
  - base64data: ""
    mediatype: "image/png"
  install:
    spec:
      clusterPermissions:
      - rules:
        - apiGroups:
          - ""
          resources:
          - persistentvolumes
          verbs:
          - get
          - list
          - watch
          - create
          - delete
        - apiGroups:
          - ""
          resources:
          - persistentvolumeclaims
          verbs:
          - get
          - list
          - watch
          - update
        - apiGroups:
          - storage.k8s.io
          resources:
          - storageclasses
          verbs:
          - get
          - list
          - watch
        - apiGroups:
          - extensions
          resourceNames:
          - nfs-provisioner
          resources:
          - podsecuritypolicies
          verbs:
          - use
        serviceAccountName: anzograph-operator
      deployments:
      - name: anzograph-operator
        spec:
          replicas: 1
          selector:
            matchLabels:
              name: anzograph-operator
          strategy: {}
          template:
            metadata:
              labels:
                name: anzograph-operator
            spec:
              containers:
              - command:
                - anzograph-operator
                env:
                - name: WATCH_NAMESPACE
                  valueFrom:
                    fieldRef:
                      fieldPath: metadata.annotations['olm.targetNamespaces']
                - name: POD_NAME
                  valueFrom:
                    fieldRef:
                      fieldPath: metadata.name
                - name: OPERATOR_NAME
                  value: anzograph-operator
                - name: RELATED_IMAGE_ANZOGRAPH_ALLINONE
                  value: registry.connect.redhat.com/cambridgesemantics/anzograph:2.2.0
                - name: RELATED_IMAGE_ANZOGRAPH_DB
                  value: registry.connect.redhat.com/cambridgesemantics/anzograph-db:2.2.0
                - name: RELATED_IMAGE_ANZOGRAPH_FRONTEND
                  value: registry.connect.redhat.com/cambridgesemantics/anzograph-frontend:2.2.0
                image: registry.connect.redhat.com/cambridgesemantics/anzograph-operator:1.3.3
                imagePullPolicy: Always
                name: anzograph-operator
                resources: {}
              serviceAccountName: anzograph-operator
      permissions:
      - rules:
        - apiGroups:
          - ""
          resources:
          - pods
          - services
          - endpoints
          - persistentvolumeclaims
          - persistentvolume
          - events
          - configmaps
          - secrets
          verbs:
          - '*'
        - apiGroups:
          - ""
          resources:
          - namespaces
          verbs:
          - '*'
        - apiGroups:
          - apps
          resources:
          - deployments
          - daemonsets
          - replicasets
          - statefulsets
          verbs:
          - '*'
        - apiGroups:
          - monitoring.coreos.com
          resources:
          - servicemonitors
          verbs:
          - get
          - create
        - apiGroups:
          - anzograph.clusters.cambridgesemantics.com
          resources:
          - '*'
          - anzographs
          verbs:
          - '*'
        - apiGroups:
          - policy
          resourceNames:
          - privileged
          resources:
          - podsecuritypolicies
          verbs:
          - use
        - apiGroups:
          - security.openshift.io
          resources:
          - securitycontextconstraints
          resourceNames:
          - anyuid
          verbs:
          - use
        serviceAccountName: anzograph-operator
    strategy: deployment
  installModes:
  - supported: true
    type: OwnNamespace
  - supported: true
    type: SingleNamespace
  - supported: false
    type: MultiNamespace
  - supported: true
    type: AllNamespaces
  keywords:
  - Big Data
  - Database
  links:
  - name: Anzograph Operator
    url: https://anzograph-operator.domain
  maintainers:
  - email: frank@cambridgesemantics.com
    name: Frank Schwichtenberg
  maturity: alpha
  provider:
    name: Cambridge Semantics
  version: 1.3.3
